@bleuterosome Is it a Maine coon mix; how to tell:

When you first saw your cat, were you like "dawwww, my baby, so cute and fluffy!" or are you like "why is that cat the size of a buick and why does it have Ron Pearlman's face??"  

If it's the latter, then you have a Maine coon mix.

